import AddIcon from "@mui/icons-material/Add";
import RemoveIcon from '@mui/icons-material/Remove';
import styled from "styled-components";


const Count = ({inc ,dec , count }) => {

  return (
    <>
      <Wrapper>
        <div className="count">
          <div className="count_btn">
            <AddIcon className="count_icon"  onClick={() =>inc()}/>
            <p className="count_icon">{count}</p>
            <RemoveIcon className="count_icon"   onClick={() =>dec()}/>
          </div>
        </div>
      </Wrapper>
    </>
  );
};
const Wrapper = styled.section`
  padding: .5rem 0;
  .count{
  .count_btn {
    color: ${({ theme }) => theme.colors.text};
    display: flex;
    align-items: center;
    justify-content: flex-start;
    gap: 1rem;

    .count_icon {
      font-size: 2rem;
    }

  }

  }
`;
export default Count;
